DROP PROCEDURE IF EXISTS `migrate_faculty_to_users`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `migrate_faculty_to_users` ()   BEGIN
  IF EXISTS (SELECT 1 FROM information_schema.tables
             WHERE table_schema = DATABASE() AND table_name = 'staging_active_faculty') THEN

    -- Create temp campus map if campus names exist in staging (optional).
    -- Add any campuses from staging that are not in campuses table.
    SELECT DISTINCT TRIM(Campus) AS name, LEFT(TRIM(Campus),3)
    FROM staging_active_faculty s
    WHERE TRIM(Campus) <> '' AND TRIM(Campus) IS NOT NULL
      AND NOT EXISTS (SELECT 1 FROM campuses c WHERE c.name=TRIM(s.Campus));

    -- Insert staff; ignore duplicates on email.
    SELECT
      'STAFF' AS role,
      NULLIF(TRIM(FIRST), '')      AS first_name,
      NULLIF(TRIM(Last), '')       AS last_name,
      LOWER(TRIM(Email))           AS email,
      NULLIF(TRIM(Reference), '')  AS reference_number,
      1 AS is_active
    FROM staging_active_faculty sf
    WHERE sf.Email IS NOT NULL AND sf.Email <> '';

  END IF;
END$$

